INSERT INTO `Node_Language` VALUES (1,3,'MIGR_Migrant Survey','MIGR_Migrant Survey','2017-10-23 01:37:40'),(2,3,'Work for an employer (not in my own business and not self-employed)','أعمل عند صاحب عمل (ليس في  عملي الخاص وليس لحسابي الخاص','2017-10-23 01:37:40'),(3,3,'Self-employed or own business','أعمل لحسابي الخاص أو عملي الخاص','2017-10-23 01:37:40'),(4,3,'Unsure/don\'t know','غير متأكد / لا أعرف','2017-10-23 01:37:40'),(5,3,'Refused','أرفض','2017-10-23 01:37:40'),(6,3,'Now I am going to ask you some general question about your employment.  In your main job, that is where you spend the most hours working, do you work for an employer or in your own business?','الآن سوف أسألك بعض الأسئلة العامة حول عملك. في وظيفتك الرئيسية، هذا هو المكان الذي تقضيه معظم ساعات العمل، هل تعمل لصاحب العمل أو في عملك الخاص؟','2017-10-23 01:37:40'),(7,3,'How many other people work in this business?','كم عدد الأشخاص الآخرين الذين يعملون في هذا العمل','2017-10-23 01:37:40'),(8,3,'Work alone','أعمل بمفردي','2017-10-23 01:37:40'),(9,3,'Less than 5 people','أقل من  ٥  أشخاص','2017-10-23 01:37:40'),(10,3,'Between 5 and 19 people','مابين  ٥    إلى   ١٩ شخص','2017-10-23 01:37:40'),(11,3,'Between 20 and 199 people','مابين ٢٠  إلى    ١٩٩ شخص','2017-10-23 01:37:40'),(12,3,'200 or more people','٢٠٠  شخص أو أكثر','2017-10-23 01:37:40'),(13,3,'In your main job, are you full time or part time? (Interview note: Part time is usually less than 37.5 hrs a week)','في وظيفتك الرئيسية، هل أنت تعمل بدوام كامل أم بدوام جزئي؟ ( ملاحظة: دوام جزئي هو عادة أقل من 37.5 ساعة في الأسبوع','2017-10-23 01:37:40'),(14,3,'Full-time','دوام كامل','2017-10-23 01:37:40'),(15,3,'Part- time','دوام جزئي','2017-10-23 01:37:40'),(16,3,'Unsure','غير متأكد','2017-10-23 01:37:40'),(17,3,'In your main job, are you (Interviewer read options)','في وظيفتك الرئيسية، هل أنت  ( يقرأ المقابل الخيارات','2017-10-23 01:37:40'),(18,3,'Casual','تعمل بعمل عارض عند الطلب','2017-10-23 01:37:40'),(19,3,'Fixed term contract with no set hours or with 