:37:40'),(51,3,'I have a secure future in my job (Interviewer read options)','لدي مستقبل آمن في وظيفتي (يقرأ المقابل الخيارات','2017-10-23 01:37:40'),(52,3,'Company I work for (or your own company) will be in business in 5 years (Interviewer read options)','الشركه  التي أعمل لديها (أو شركتي الخاصة) سيزدهر عملها التجاري خلال الخمس  السنوات القادمة  (يقرأ المقابل الخيارات','2017-10-23 01:37:40'),(53,3,'I worry about the future of my job (or of your company) (Interviewer read options)','أنا قلق بشأن مستقبل عملي  (أو شركتي الخاصة)  (يقرأ المقابل الخيارات','2017-10-23 01:37:40'),(54,3,'I get paid fairly for the things I do in my job (Interviewer read options)','أنا أحصل على أجر عادل مقابل الاشياء التي أقوم بها في عملي (يقرأ المقابل الخيارات','2017-10-23 01:37:40'),(55,3,'Do you receive support and encouragement from your co-workers (Interviewer read options)','هل تتلقى الدعم والتشجيع من زملائك في العمل؟  (يقرأ المقابل الخيارات','2017-10-23 01:37:40'),(56,3,'Never','أبدا','2017-10-23 01:37:40'),(57,3,'Usually not','عادة لا','2017-10-23 01:37:40'),(58,3,'Sometimes','بعض الأحيان','2017-10-23 01:37:40'),(59,3,'Usually','عادة','2017-10-23 01:37:40'),(60,3,'Always','دائما','2017-10-23 01:37:40'),(61,3,'I don\'t have co-workers','ليس لدي  زملاء عمل','2017-10-23 01:37:40'),(62,3,'Do you receive support and encouragement from your supervisor (Interviewer note: they may say they have a manager and not a supervisor which is fine, also read options)','هل تتلقى الدعم والتشجيع من مشرفك؟ (ملاحظه للمقابل: قد يقولون إن لديهم مدير وليس مشرفا.  هذا الامر عادي .   أيضا  اقراء الخيارات','2017-10-23 01:37:40'),(63,3,'In the last 12 months, has there been a time in your job when you were made to feel that you could be easily replaced by a boss or supervisor. Would you disagree or agree with this statement','في  ١٢ الأشهر الأخيرة، هل مر عليك وقت في عملك شعرت فيه بأنه يمكن استبدالك بسهولة من قبل رئيس العمل أو المشرف. هل لا توافق أو توافق على هذا العبارة؟','2017-10-23 01:37:40'),(64,3,'In the last 12 months, has there been a time in your job when you were afraid of being fired, even though you did nothing wrong. Would you disagree or agree with this statement','في  ١٢ الأشهر الأخيرة، هل مر عليك وقت في عملك كنت خائفا من فصلك من العمل، على الرغم من أنك لم تفعل شيئا خاطئا. هل لا توافق أو توافق على هذه العبارة؟','2017-10-23 01:37:40'),(65,3,'In the last 12 months, has there been a time in your job when you were treated in a discriminatory or unjust way on your job. Would you disagree or agree with this statement','في ١٢ الأشهر الأخيرة، هل مر عليك وقت في عملك تم التعامل معك بطريقة تمييزية أو غير عادلة في العمل. هل لا توافق أو توافق على هذه العبارة؟','2017-10-23 01:37:40'),(66,3,'In the last 12 months, has there been a time in your job when you were concerned about your safety on your job but were afraid to voice your concern. Would you disagree or agree with this statement','في ١٢ الأشهر الأخيرة، هل مر عليك وقت في عملك كنت فيه قلقا بشأن سلامتك في العمل ولكن كنت تخشى التعبير عن قلقك. هل لا توافق أو توافق على هذه العبارة؟','2017-10-23 01:37:40'),(67,3,'You felt defenceless against unfair treatment directed toward you on your job,  Would you disagree or agree with this statement','شعرت بأنك عاجز عن الدفاع ضد المعاملة غير العادلة الموجهة نحوك في عملك. هل لا توافق أو توافق على هذه العبارة؟','2017-10-23 01:37:40'),(68,3,'I don\'t have a supervisor (this can also be termed a manager)','ليس لدي مشرف او مدير','2017-10-23 01:37:40'),(69,3,'Not applicable I own my company/business','لا ينطبق، أمتلك شركتي / عملي التجاري','2017-10-23 01:37:40'),(70,3,'Have you ever been bullied?','هل تعرضت للبلطجة من قبل؟','2017-10-23 01:37:40'),(71,3,'How often would you say that you had been bullied? (Interviewer read options)','كم عدد المرات التي تذكر أنك تعرضت  فيها للبلطجة؟ (يقرا المقابل الخيارات','2017-10-23 01:37:40'),(72,3,'Rarely','نادرا','2017-10-23 01:37:40'),(73,3,'Often','غالبا','2017-10-23 01:37:40'),(74,3,'All of the time','كل الوقت','2017-10-23 01:37:40'),(75,3,'Unsure/can\'t